// AlbumTiles.jsx
import React from "react";

import "./AlbumTiles.scss";

const AlbumTiles = (props) => {
  const { title, albumsArr } = props;
  console.log(albumsArr);

  const albumTiles = albumsArr.map((album, index) => {
    return (
      <img
        key={title + index}
        className="album-tiles_img"
        src={album.strAlbumThumb}
        alt={album.strAlbum}
      />
    );
  });
  return (
    <>
      <h3>{title}</h3>
      <div className="album-tiles"> {albumTiles} </div>
    </>
  );
};

export default AlbumTiles;
